function getCoralTheme(){
    var theme_coral = {
        "left" : "data:image/png;base64,",
        "right" : "data:image/png;base64,",
        "lupa" : "data:image/png;base64,"
    };

    return theme_coral;
}


$( document ).ready(function() {
    var theme_coral = getCoralTheme();

    $('.fast_search_prev').css('background','url(' + theme_coral['left'] + ')');
    $('.fast_search_next').css('background','url(' + theme_coral['right'] + ')');
    $('.fast_search_result').css('background','#FF7A7C').css('border','none').css('border-radius','15px');
    $('#searchbox_id').css('background','url(' + theme_coral['lupa'] + ')no-repeat #FFF').css('background-position-y','2px')
        .css('background-position-x','98%').css('border','none').css('border-radius','0');

// minimization of search form
    chrome.storage.sync.get('fast_search_minimal_style', function(a) {
        var x = a['fast_search_minimal_style'];
        if(x){
            minimize_search_form();
        }
        else
        {
            maximize_search_form();
        }
    });

    //minimize_search_form();
});

function maximize_search_form()
{
    $('.fast_search_result').removeClass('mini');
}


function minimize_search_form()
{
    $('.fast_search_result').addClass('mini');
}